import React from "react";

const ImageForm = () => {
    return (
        <div>
            <p className="f3">
                {'face detection'}
            </p>
            <div>
                <input className="f4 pa2 w-7 center" type="text" />
                <button className="w-30 grown f4 link ph3">Detect</button>
            </div>
        </div>
    )
}

export default ImageForm;
